import React, { useState, useEffect } from 'react';
import { getTenants, createTenant, updateTenant, deleteTenant } from '../api';

const Tenants = () => {
    const [tenants, setTenants] = useState([]);
    const [newTenant, setNewTenant] = useState({
        name: '',
        contact: '',
        startDate: '',
        endDate: '',
        roomNo: '',
        rent: '',
    });
    const [editingTenant, setEditingTenant] = useState(null);

    useEffect(() => {
        fetchTenants();
    }, []);

    const fetchTenants = async () => {
        try {
            const data = await getTenants();
            setTenants(data);
        } catch (error) {
            console.error('Error fetching tenants', error);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewTenant({ ...newTenant, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (editingTenant) {
                await updateTenant(editingTenant.id, newTenant);
                setEditingTenant(null);
            } else {
                await createTenant(newTenant);
            }
            fetchTenants();
            setNewTenant({
                name: '',
                contact: '',
                startDate: '',
                endDate: '',
                roomNo: '',
                rent: '',
            });
        } catch (error) {
            console.error('Error saving tenant', error);
        }
    };

    const handleEdit = (tenant) => {
        setEditingTenant(tenant);
        setNewTenant(tenant);
    };

    const handleDelete = async (id) => {
        try {
            await deleteTenant(id);
            fetchTenants();
        } catch (error) {
            console.error('Error deleting tenant', error);
        }
    };

    return (
        <div>
            <h1>Tenants</h1>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    name="name"
                    value={newTenant.name}
                    onChange={handleInputChange}
                    placeholder="Name"
                    required
                />
                <input
                    type="text"
                    name="contact"
                    value={newTenant.contact}
                    onChange={handleInputChange}
                    placeholder="Contact"
                    required
                />
                <input
                    type="date"
                    name="startDate"
                    value={newTenant.startDate}
                    onChange={handleInputChange}
                    placeholder="Start Date"
                    required
                />
                <input
                    type="date"
                    name="endDate"
                    value={newTenant.endDate}
                    onChange={handleInputChange}
                    placeholder="End Date"
                    required
                />
                <input
                    type="text"
                    name="roomNo"
                    value={newTenant.roomNo}
                    onChange={handleInputChange}
                    placeholder="Room No"
                    required
                />
                <input
                    type="number"
                    name="rent"
                    value={newTenant.rent}
                    onChange={handleInputChange}
                    placeholder="Rent"
                    required
                />
                <button type="submit">{editingTenant ? 'Update Tenant' : 'Add Tenant'}</button>
                {editingTenant && <button onClick={() => setEditingTenant(null)}>Cancel</button>}
            </form>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Contact</th>
                        <th>Start Date</th>
                        <th>End Date</th>
                        <th>Room No</th>
                        <th>Rent</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {tenants.map((tenant) => (
                        <tr key={tenant.id}>
                            <td>{tenant.name}</td>
                            <td>{tenant.contact}</td>
                            <td>{tenant.startDate}</td>
                            <td>{tenant.endDate}</td>
                            <td>{tenant.roomNo}</td>
                            <td>{tenant.rent}</td>
                            <td>
                                <button onClick={() => handleEdit(tenant)}>Edit</button>
                                <button onClick={() => handleDelete(tenant.id)}>Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Tenants;
